# Source: jx-role-controller/templates/deployment.yaml
apiVersion: extensions/v1beta1
kind: Deployment
metadata:
  name: release-name-jx-role-controller
  labels:
    draft: draft-app
    chart: "jx-role-controller-0.0.22"
spec:
  replicas: 1
  template:
    metadata:
      labels:
        draft: draft-app
        app: release-name-jx-role-controller
    spec:
      serviceAccountName: release-name-jx-role-controller
      containers:
      - name: rc
        image: "gcr.io/jenkinsxio/jx-role-controller:0.0.22"
        imagePullPolicy: IfNotPresent
        env:
        - name: JX_LOG_FORMAT
          value: "stackdriver"
        - name: JX_CONTROLLER_NO_WATCH
          value: "false"
        resources:
            limits:
              cpu: 100m
              memory: 128Mi
            requests:
              cpu: 100m
              memory: 128Mi
